import React from "react";
import LargeButton from "./LargeButton";
import Title from "./Title";
import InputField from "./InputField";
import Footer from "./Footer";
import PhoneImage from "./PhoneImage";
import { Container, Row, Col } from "react-bootstrap";
import "bootstrap";

class Home extends React.Component {
    constructor() {
        super();
        this.state = {

        }
        this.handleClickRegistration = this.handleClickRegistration.bind(this);
        this.handleClickLogIn = this.handleClickLogIn.bind(this);
    }
    handleClickRegistration() {

    }
    handleClickLogIn() {
    }

    render() {
        return (
            <div className="container-fluid" >
                <div className="row">
                    <div className="col" ></div>
                    <div className="col-md-auto" >
                        <Title
                            fontSize="140px"
                            fontWeight="lighter"
                            color="#666666"
                            text="#TECH"
                        />
                    </div>
                    <div className="col"></div>
                </div>
                <div className="row">
                    <div className="col"></div>
                    <div className="col-md-auto">
                        <Title
                            fontSize="40px"
                            fontWeight="lighter"
                            color="#b2b2b2"
                            text="New thinking. New #tech."
                        />
                    </div>
                    <div className="col"></div>
                </div>
                <div className="row">
                    <div style={{ visibility: "hidden", fontSize: "30px" }}>d</div>
                </div>
                <div className="row">
                    <div className="col-lg-6 col-md-12 col-sm-12 col-xs-12" style={{ backgroundColor: "red" }}>
                        <PhoneImage style={{ width: "80%", marginLeft: "50px" }} />
                    </div>
                    <div className="col-lg-6 col-md-12 col-sm-12 col-xs-12" style={{ backgroundColor: "yellow" }}>
                        <div className="d-flex align-items-center" style={{ backgroundColor: "black"}}>

                            <div className="d-flex justify-content-center">
                                <Title
                                    fontSize="50px"
                                    fontWeight="bold"
                                    color="#666666"
                                    text="W E L C O M E"
                                />
                            </div>
                            <div className="d-flex justify-content-center">
                                <InputField type="text" placeholder="Email" style={{ marginTop: "10px", width: "450px", height: "50px" }} />
                            </div>
                            <div className="d-flex justify-content-center">
                                <InputField type="password" placeholder="Password" style={{ marginTop: "20px", width: "450px", height: "50px" }} />
                            </div>
                            <div className="d-flex justify-content-center">
                                <a href="" style={{ marginTop: "10px" }}>New user? Register here.</a>
                            </div>
                            <div className="d-flex justify-content-center">
                                <LargeButton
                                    value="LOG IN"
                                    style={{
                                        width: "200px",
                                        height: "50px",
                                        borderRadius: "10px",
                                        backgroundColor: "#2d2d2d",
                                        borderColor: "#2d2d2d",
                                        fontSize: "20px",
                                        color: "white"
                                    }}
                                    handleClick={this.handleClickLogIn}
                                />
                            </div>
                        </div>

                    </div>
                </div>
            </div>
        );
    }


}

export default Home;
